function prepareNavigation(){function f(){const n=Number(document.getElementById("currentNumber").textContent);n!=1&&$("#reviews-container").load(`/Reviews/GetNextReviews?teacherId=${i}&currentNumber=${0}`,null,prepareNavigation)}function e(){const r=Number(document.getElementById("currentNumber").textContent),t=r-n;t>0&&$("#reviews-container").load(`/Reviews/GetNextReviews?teacherId=${i}&currentNumber=${t-n}`,null,prepareNavigation)}function o(){const r=Number(document.getElementById("currentNumber").textContent);t-r-n+1>0&&$("#reviews-container").load(`/Reviews/GetNextReviews?teacherId=${i}&currentNumber=${r}`,null,prepareNavigation)}function s(){if(!(t/n<1)){const r=Number(document.getElementById("currentNumber").textContent);if(t!=n+r-1){const u=t-n*2+1;$("#reviews-container").load(`/Reviews/GetNextReviews?teacherId=${i}&currentNumber=${u}`,null,prepareNavigation)}}}const n=4,t=Number(document.getElementById("allRatingsCount").textContent);document.getElementById("to-start").addEventListener("click",f);document.getElementById("previous").addEventListener("click",e);document.getElementById("next").addEventListener("click",o);document.getElementById("to-end").addEventListener("click",s);const r=window.location.search,u=new URLSearchParams(r),i=u.get("teacherId")}window.addEventListener("load",prepareNavigation);